message:
Alguns pensamentos e fatos:

Rodrigo Constantino, Jovem Pan, Rede Record, Guilherme Fiuza e outros falando abertamente em ditadura da toga instaurada;

Alexandre Garcia dizendo o mesmo e ainda falando no artigo, aquele artiguinho lá da Constituição,  o 142 💪🏻;

Presidente tranquilo e subindo nas intenções de voto enquanto o descondenado está caindo (até o "data falha" admite);

Forças armadas num silêncio sepulcral quanto àquelas maquininhas "mágicas" de votos, aquelas urnas eletrônicas, e com militares negando ao Ditador mor do Judiciário qualquer informação antes da conclusão das eleições;

Presidente e Forças Armadas quietinhos quantos às urnas,  sem fazerem mais nenhuma crítica,  como se tudo estivesse resolvido...; por quê ? Provavelmente porque não precisam mais criticar e se desgastarem, pois já pegaram os bandidos togados e canhotos nas fraudes do primeiro turno... ? ! ? !!!

Creio que a ditadura aqui 🇧🇷 está com os dias contados.

A propósito, não existe na história ditadura que tenha se sustentado sem as forças armadas ao seu lado.

Alguém acha que aqui no 🇧🇷 as forças armadas estão do lado dos corruptos vermelhos ou dos ditadores togados ?

Quem disser que sim tem que voltar para a escola 😂

ATENÇÃO*
Lista de Proibições do TSE

